import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Layout/Navbar';
import Footer from './components/Layout/Footer';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-50 flex flex-col">
        <Navbar />
        
        <main className="flex-grow">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/flights" element={<FlightsPage />} />
            <Route path="/bookings" element={<BookingsPage />} />
            <Route path="/profile" element={<ProfilePage />} />
          </Routes>
        </main>
        
        <Footer />
      </div>
    </Router>
  );
}

// Placeholder komponente dok ne kreirate prave stranice
const HomePage = () => (
  <div className="container mx-auto px-4 py-8">
    <h1 className="text-4xl font-bold text-center text-blue-600 mb-8">
      Dobrodošli u Airflight Company
    </h1>
    <div className="text-center text-gray-600">
      <p className="mb-4">Vaš partner za putovanja širom sveta</p>
      <p>Stranica u razvoju...</p>
    </div>
  </div>
);

const FlightsPage = () => (
  <div className="container mx-auto px-4 py-8">
    <h1 className="text-3xl font-bold mb-6">Pretraga letova</h1>
    <p className="text-gray-600">Stranica u razvoju...</p>
  </div>
);

const BookingsPage = () => (
  <div className="container mx-auto px-4 py-8">
    <h1 className="text-3xl font-bold mb-6">Moje rezervacije</h1>
    <p className="text-gray-600">Stranica u razvoju...</p>
  </div>
);

const ProfilePage = () => (
  <div className="container mx-auto px-4 py-8">
    <h1 className="text-3xl font-bold mb-6">Moj profil</h1>
    <p className="text-gray-600">Stranica u razvoju...</p>
  </div>
);

export default App;
